import React from 'react'
import Person from './Person';

function NameList() {
    const persons = [
      {
        id: 1,
        name: "Brucee",
        age: 30,
        skill: "React",
      },
      {
        id: 2,
        name: "Namboy",
        age: 20,
        skill: "PHP",
      },
      {
        id: 3,
        name: "Dede",
        age: 10,
        skill: "Android",
      },
    ];
    const personList = persons.map((person) => (
      <Person key={person.name} person={person} />
    ));

    return (
        <div>
            {personList}
        </div>
    )
}

export default NameList
